window.bookSummaryJSON = "<p><b>They met under the guise of a masquerade—their faces hidden—and yet they felt seen for the very first time.</b></p> <p>Eager to learn more about her darkest desires, Freya throws caution to the wind, attending Club Venom's masquerade ball with her best friend, never anticipating how her life would change. She's always known there's something different about her, but she's never given in to her wildest fantasies… until now.</p> <p>\"Where to begin… patience or punishment?\"</p> <p>Pierce Harrison doesn't believe in forever. He's a world-renowned surgeon, clinical in all aspects of his life. Relationships are temporary, and he makes sure emotions are left at the door. What happens at Venom, stays at Venom.</p> <p>With a dark past that both haunts and drives his success in everything he does, Pierce finds his world tilted on its axis the night he meets a masked beauty who ensures his heart will be irrevocably altered.</p> <p>With nothing to lose and everything to gain, Pierce and Freya must fight their inner demons, forging a path neither of them knew they wanted, but both of them crave.</p> <p><i>A standalone romance in the Club V series featuring an HEA, he falls first, no third-act breakup, BDSM, and a millionaire doctor.</i></p>"; 
